import logo from './images/uno_O.png';
import './App.css';
import './MyCustom.css';

/* Me playing around with a react elemnt */

let isClicked = false; /* Globally declaring boolean so all functions can view it */

/*
 * NOTE:
 * - Hooks
 *   1. can ONLY be called in React function components
 *   2. can ONLY be called @ top level of said component
 *   3. can NOT be conditional
 */

/* This element uses JSX as page formatting (But how is it different than HTML doe?) */
function AboutPage() {
    return (
        <>
            <header className="Author-Bits">
                <h1>About me!</h1>
                <p>
                    My name is Seth and I have no React experience lol<br/>
                    Let me insert this custom React element here to play around with React stuff.<br/>
                    I'm declared in <code>src/App.js</code> and called as an element in <code>App()</code>
                </p>
            </header>
        </>
    )
}

// Class component can be used to create custom React elements that inheriet 
// the React Component interface and respective functions
// Much more complex, but I think it'S worth exploring. TODO?

// class Item extends React.Component { /* For some reason, the React.Component
// isn't recognized... */
//     render() {
//         return <h3> I'm a class component!</h3>;
//     }
// }
// Rendered like a function element in HTML
//   root.render(<Item />)

/* I'm displayed if a button is clicked. Which one? Figure yout yourself ;) */
function Confirmed() {
    return (
        <>
            <div className="Confirmed">
                <h2>You clicked the button!</h2>
            </div>
        </>
    )
}

/* I'm displayed waiting for the button is clicked. */
function Waiting() {
    return (
        <>
            <p>waiting...</p>
        </>
    )
}

/* my contents changed if a button is clicked */
function ConditionalTest() {
    /* But I can also use the ? operator inside JSX elements too */
    return (
        <div>
            {isClicked ? (
                <Confirmed />
            ) : (
                    <Waiting />
                )
            }
        </div>
    )
}

/* I'm a button function that toggles the boolean `isClicked` */
function toggle() {
    if (isClicked) {
        isClicked = false;
    } else {
        isClicked = true;
    }
}

function App() {
    /* I can use conditionals to load different elements! */
    let content;

    if (isClicked) {
        content = <Confirmed />
    } else {
        content = <Waiting />
    }

    return (
        <div className="App">
            <header className="App-header">

            <nav className="AppNav">
                <div className="NavLink">
                    <a 
                        href="https://reactjs.org"
                       target="_blank"
                        rel="noopener noreferrer"
                    >
                        <button>Learn React</button> 
                    </a>
                    <a
                        href="https://www.w3schools.com/REACT/react_getstarted.asp"
                        target="_blank"
                        rel="noopener noreferrer"
                    >
                        <button>W3 schools</button> 
                    </a>

                    <button onclick={() => toggle()}>Click me!</button>
                </div>
            </nav>

            <div className="buffer"></div>

            </header>

            <body className="AppContent">
                <img src={logo} className="App-logo" alt="logo" />

                <h1>Welcome to JumpStart!</h1>

                <p>
                    It does nothing right now. Enjoy this spinning icon!
                </p>

                <p>Here's me demoing a conditional by using a JS insert and logical AND. I guess it prints the output of isClicked when not displaying <code>Confirmed</code>.</p>
                <div>
                    {isClicked && <Confirmed />}
                </div>

                <p>And here's me using element <code>ConditionalTest</code> to show off ternary operators</p>
                <ConditionalTest />

                <p>And here's using a variable <code>content</code> assigned to an element based on a conditional defined earlier.</p>
                <p>All of thse examples suck and are buggy. The first one does actually toggle, but then breaks after reloading the page</p>
                {content}

            </body>

            <footer>
                <AboutPage className="Author-Bits"/>
            </footer>
        </div>
    );
}

// I can only call functions declared here IN here. If I try importing any outside the one function designated to be exported, it treats that as if I just call the exported function again.
export default App; /* Only ONE can be exported */
